import React from 'react';

const Counter = () =>{
    let num = 0;

    const clickPlus = () =>{
        num ++;
    }


    return(
        <div>
            <p>{num}</p>
            <button onClick={clickPlus}>+</button>
        </div>
    )
}

export default Counter;
